import React from "react";
import "./Profile.css";

function Profile() {
  return (
    <>
      <div className="profile-container">
        <p> PRO </p>
        <img
          src="https://static.toiimg.com/photo/msid-76085016/76085016.jpg?298194"
          alt="disha"
        />
      </div>
    </>
  );
}

export default Profile;
